command.post_template:
{* get the Serial interface bandwidth from the matching controller timeslot *}
{if $params.type == "Serial" &&  isset($controller)}
	{foreach $controller as $c}
		{if $c.interface == $params.controller_module}
			{if isset($c.channel_group) 
				&& ($c.channel_group == $params.controller_channel)}
				{assign_object_variable 
					var="bandwidth"
					value=$c.bandwidth}
				{break}
			{/if}
			{if isset($c.modes)}
				{foreach $c.modes as $mode}
					{foreach $mode.timeslots_array as $timeslots}
						{if $timeslots.sub_interface ==  "{$params.controller_submodule}:{$params.controller_channel}"}
							{assign_object_variable
								var="bandwidth"
								value=$timeslots.bandwidth}
						{/if}
					{/foreach}
				{/foreach}
			{/if}

		{/if}
	{/foreach}
{/if}
{* get the bandwidth from the Serial interface based on the multilink group *}
{if $params.type == "Multilink" &&  isset($interface)}
	{foreach $interface as $itf}
		{if isset($itf.bandwidth) 
			&& $itf.type == "Serial" 
			&& (isset($itf.multilink_group)) 
			&& (isset($params.multilink_group)) 
			&& ($itf.multilink_group == $params.multilink_group)}
			{assign_object_variable
				var="bandwidth"
				value=$itf.bandwidth}
		{/if}
	{/foreach}
{/if}

{if isset($params.validated) && $params.validated == "!"}
	{assign_object_variable
		var="validated"
		value=true}
{else}
	{assign_object_variable
		var="validated"
		value=false}
{/if}
{assign_object_variable
		var="orig_object_id"
		value=$params.object_id}
